import deleteIcon from "../assets/deleteButton.jpeg";
import editIcon from "../assets/editButton.png";
import Tooltip from "react-bootstrap/Tooltip";
import selectButton from "../assets/selectButton.png";
import OverlayTrigger from "react-bootstrap/OverlayTrigger";
import { TypeContext } from "../contexts/TypeContext";
import { useContext, useEffect, useState } from "react";
import { DataContext } from "../contexts/DataContext";

const PostButtonTypeModal = ({
  type,
  TDS,
  dead_TDS,
  PH,
  dead_PH,
  nutri_Ratio,
}) => {
  const { config } = useContext(DataContext);
  const { deleteConfigType, findConfigType, setShowUpdateTypeModal } =
    useContext(TypeContext);

  const chooseType = (configTypeId) => {
    findConfigType(configTypeId);
    setShowUpdateTypeModal(true);
  };
  // console.log(type, TDS, dead_TDS, PH, dead_PH, nutri_Ratio);
  const chooseCurrentType = (configTypeId) => {
    findConfigType(configTypeId);
    (async (event) => {
      try {
        const { message } = await config({
          type: type,
          TDS: TDS,
          dead_TDS: dead_TDS,
          PH: PH,
          dead_PH: dead_PH,
          nutri_Ratio: nutri_Ratio,
        });
      } catch (error) {
        console.log(error);
      }
    })();
  };
  // const onClickConf = async (event) => {
  //   try {
  //     const { message } = await config({
  //       type: type,
  //       TDS: TDS,
  //       dead_TDS: dead_TDS,
  //       PH: PH,
  //       dead_PH: dead_PH,
  //       nutri_Ratio: nutri_ratio,
  //     });
  //   } catch (error) {
  //     console.log(error);
  //   }
  // };

  return (
    <div>
      <OverlayTrigger
        placement="left"
        overlay={<Tooltip>Choose this type for current config</Tooltip>}
      >
        <button className="type-button" onClick={chooseCurrentType}>
          <img src={selectButton} width="30" height="30" />
        </button>
      </OverlayTrigger>
    </div>
  );
};
export default PostButtonTypeModal;
